import React, { Fragment } from "react";
import { Todo } from "./Todo";

export const TodoList = () => {
  return (
    <Fragment>
      <section>
        <div>
          <h1>{"공부"}</h1>
          <button>:</button>
        </div>
        <ul>
          <Todo></Todo>
        </ul>
      </section>
    </Fragment>
  );
};
